  return (
    <Row>
      <Col span={24}>
        <Row>
          <Col
            sm={12}
            md={12}
            xs={24}
            lg={6}
            // span={6}
          >
            <Row>
              <Col span={24}>
                <div className="container_product">
                  <Image
                    width={377}
                    src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                    preview={false}
                    className="Image"
                  />
                  <div className="backgroud_hidden"></div>
                </div>
              </Col>
              <Col span={24}>
                <div className="description_product">
                  <h3>IPHONE X</h3>
                  <p>Lorem ipsum dolor sit amet</p>
                </div>
              </Col>
            </Row>
            {/* <div className="container_product">
              <Image
                width={377}
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
