                className="Image"
              />
              <div className="backgroud_hidden"></div>
            </div> */}
            {/* <div className="description_product">
              <h3>IPHONE X</h3>
              <p>Lorem ipsum dolor sit amet</p>
            </div> */}
          </Col>
          <Col
            sm={12}
            // span={6}
            xs={24}
            md={12}
            lg={6}
            style={{
              //   width: 477,
              border: '1px solid #D1D5DB'
            }}
          >
            <div
              style={{
                display: 'flex',
                justifyContent: 'center'
              }}
            >
              <Image
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                width={377}
                style={{ marginTop: 72 }}
                preview={false}
              />
            </div>
            <div className="description_product">
              <h4>Iphone X</h4>
              <p>Lorem ipsum dolor sit amet</p>
            </div>
          </Col>
          <Col
            xs={24}
            sm={12}
            md={12}
            lg={6}
            // span={6}
            style={{
              //   width: 477,
              border: '1px solid #D1D5DB'
            }}
          >
            <div
              style={{
                display: 'flex',
                justifyContent: 'center'
              }}
            >
              <Image
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                width={377}
                style={{ marginTop: 72 }}
                preview={false}
              />
            </div>
            <div className="description_product">
              <h4>Iphone X</h4>
              <p>Lorem ipsum dolor sit amet</p>
            </div>
          </Col>
          <Col
            xs={24}
            sm={12}
            md={12}
            lg={6}
            // span={6}
            style={{
              border: '1px solid #D1D5DB'
            }}
          >
            <div
              style={{
                display: 'flex',
                justifyContent: 'center'
              }}
            >
              <Image
                src="https://cdn.tgdd.vn/Products/Images/42/213031/iphone-12-xanh-duong-600x600.jpg"
                width={377}
                style={{ marginTop: 72 }}
                preview={false}
              />
            </div>
            <div className="description_product">
              <h4>Iphone X</h4>
              <p>Lorem ipsum dolor sit amet</p>
            </div>
          </Col>
        </Row>
      </Col>
    </Row>
  );
};

export default Product;
